import React from 'react';
import Navbar from 'react-bootstrap/Navbar'

function Nav() {
	return (
        <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#home">TP REACT</Navbar.Brand>
        <Nav className="mr-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/firstapi">Placeholder</Nav.Link>
            <Nav.Link href="/secondapi">AnimeList</Nav.Link>
        </Nav>
        </Navbar>
	)
}

export default Nav;
